- input: "TEXT\x1CC00114439\x1CTEXT-00001\x1C\x1CF3XA\x1CJanuary 10, 2013    Mr. James
    McAllister  Campaign Finance Analyst  Reports Analysis Division  Federal Election
    Commission  999 E Street, NW  Washington, DC 20463    Re: Washington State Democratic
    Central Committee, FEC Id. No.C00114439, 2012 September Monthly Report     Dear
    Mr. McAllister:    The Committee offers the following response to your letter,
    dated December 12, 2012, concerning the 2012 September Monthly Report.    1.\tIn
    regards to the transfers disclosed on Schedule A, Line 12 from the DNC, please
    note that no funds transferred into the Committee were earmarked for any exempt
    activity.  These costs met all requirements for exempt activity rules.  The Committee's
    safe harbor practices were in place to ensure this.  2.\tThe debt to Capitol City
    Press has been correctly linked to disclose on this amendment.   3.\tThe debt
    to NW Passage was disclosed in error.  The payment was made within the same month
    as the invoice was received.  The Committee has removed the item from Schedule
    D.  4.\t Schedule H2 has been corrected to reflect New instead of Same as Previously
    Reported.  5.\tThe payment to PMA Marketing on Schedule H4 disclosed as Admin
    was for DMail 12-4.  The event code has been changed to reflect this. The payment
    was for fundraising.  6.\tThe payments disclosed on Schedule H4 for the event
    code, National Convention, were for ordinary party expenses related to convention
    travel and were not undertake on behalf of any delegate.    If you have any additional
    questions regarding this response, please contact the Committee at your convenience.
    \   Sincerely,    Habib Habib  Treasurer  Please note that employees of the Committee
    that spent less than 25% of their time on Federal Election Activity were paid
    on the Schedule H4 uniform split.  Expenditures listed on Line 21B did NOT meet
    the definition of Federal Elections Activity. In addition, all fundraising, event,
    and related payments made during this period were Committee fundraising and not
    on behalf of a Federal Candidate.   Please also note that the payments made to
    vendors for Party Fundraising Consulting  are based on a contractual set amount
    per month without regard to the percentage of funds raised.  Due to the contractual
    agreement, the FEC Reports Analysis Supervisor has ruled that the payments qualify
    as Admin instead Fundraising and may be reported on Schedule H4.\n"
